function Login() {
  return (
    <Router>
      <Switch>
        <Route path="/item" component={Item} />
        <Route path="/freeboard" component={FreeBoard} />
        <Route path="/login" component={Login} />
      </Switch>
    </Router>
  );
}

export default Login;
